import React from "react";
import "./Home.css";
import { Link } from "react-router-dom";
import HB from "../images/backG.png"
//import logo from "../images/Logo.png";
import {ConnectButton, Select, DatePicker, Input} from "web3uikit";



const Home = () => {

  return (
    <>
      <div className="container" style={{ backgroundImage: `url(${HB})` }}>
        <div className="containerGradient"></div>
      </div>
      <div className="topBanner">
        <div>
        </div>
        <div className="tabs">
          <div className="selected">MetaHomes</div>
          <div> IRL Experiences </div>
          <div> MetaExperiences </div> 
        </div>
        <div className="lrContainers">
        <ConnectButton />
        </div>
      </div>
      <div className="tabContent">
        <div className="searchFields">
        <div className="inputs">
          MetaLocation
          <Select
              defaultOptionIndex={0}
              onBlurTraditional={function noRefCheck(){}}
              onChange={function noRefCheck(){}}
              onChangeTraditional={function noRefCheck(){}}
              options={[
                {
                  id: 'Mi',
                  label: 'Miami',
                },
                {
                  id: 'CS',
                  label: 'Casablanca',
                },
                {
                  id: 'la',
                  label: 'Los Angeles',
                },
                {
                  id: 'RB',
                  label: 'Rabat',
                },
                {
                  id: 'TG',
                  label: 'Tanger',
                },

              ]}
            />
        </div>
        <div className="vl"/>
        <div className="inputs">
          MetaCheck In 
          <DatePicker
              id="MetaCheckIN"
              onChange={function noRefCheck(){}}
            />
        </div>
        <div className="vl"/>
        <div className="inputs">
          MetaCheck Out
          <DatePicker
              id="MetaCheckIN"
              onChange={function noRefCheck(){}}
            />
        </div>
        <div className="vl"/>
        <div className="inputs">
          Guests
          <Input
              label=""
              type="number"
              onBlur={function noRefCheck(){}}
              onChange={(event)=> console.log(Number(event.target.value))}
            />

        </div>
        </div> 
      </div>
    </>

  );
};

export default Home;
